import * as React from 'react';
import {
    Box,
    Card,
    CardActions,
    Link,
    CardContent,
    CardMedia,
    Button,
    Typography,
    TextField,
    FormControlLabel,
  } from "@mui/material";

const CheckoutForm = () =>{
  return (
    <Box className="checkingForm">
        <Box className="">

        </Box>
        <Typography
        gutterBottom  
        variant="h6"
        component="div"
        className=""
        style={{
          paddingLeft: "3vw",
          paddingTop: "1vw",
          outline: "none",
          color: "black",
        }}
      >CHECK OUT</Typography>
    </Box>
  );
}


export default CheckoutForm
